  true,\n\t\"url\": null,\n\t\"notes\": \"There are 20 daily Federal Register issues
  (totaling 4,711 pages) included in this volume of the database. These pages were
  taken from the FR books published for the entire month of January in 1994. Each
  image was scanned binary at 15.75 pixels per millimeter (ppm), equaling 400 pixels
  per inch (ppi).  With each image is a file that contains the textual content of
  the page.  The images and associated text can be used to evaluate alternative DAR
  technologies, and they can be used in IR experiments where retrieval performance
  can be compared between retrieving the pages of text provided with the database
  and retrieving the corresponding text produced by DAR. In this way,  the  impact
  \ of recognition  errors  on retrieval  performance  can  be  evaluated  (a key
  \ goal of METTREC).\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
